const EURUSDrate = () => {
    
  const ws = new WebSocket(
    "ws://stream.tradingeconomics.com/?client=guest:guest"
  );
  ws.onmessage = (e) => {
    console.log(e);
  };
  ws.onopen = () => {
    console.log("connected");
    ws.send("{\"topic\": \"subscribe\", \"to\": \"calendar\" }")
    ws.send("{\"topic\": \"subscribe\", \"to\": \"EURUSD:CUR\" }")
  }
  return <div>hola</div>;
};

export default EURUSDrate;
